-- ----------------------------
--  Table structure for `autox_mod_categories`
-- ----------------------------
DROP TABLE IF EXISTS `autox_mod_categories`;
CREATE TABLE `autox_mod_categories` (
  `category_id` int(11) NOT NULL,
  `category_name` varchar(25) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  `mandatory_selection` varchar(1) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  `default_mod_id` int(11) DEFAULT NULL,
  `increase_amount_for mod_points` decimal(4,2) DEFAULT NULL,
  `description` varchar(100) CHARACTER SET latin1 COLLATE latin1_general_ci NOT NULL,
  `notes` varchar(1000) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `multiselect` varchar(1) DEFAULT NULL,
  PRIMARY KEY (`category_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

-- ----------------------------
--  Records of `autox_mod_categories`
-- ----------------------------
BEGIN;
INSERT INTO `autox_mod_categories` VALUES ('1', 'Tires', 'Y', '4', null, 'Tires selection', '<p>Note that r-comps are defined as having tread wear less than 110. Don\'t know which?</p>\n<ul>\n<li>All-season tires come standard on most non-M cars without the sports or performance package. They\'ll clearly say \'M+S\' on the sidewall\n<li>Summer tires come standard on most M cars and cars with the sports or performance package\n<li>Examples of cross-tread R comp tires: Michelin Pilot Sport Cup (not Pilot Sport or Pilot Sport PS2), Kumho Victoracer V700/Ecsta V700, Toyo RA-1\n<li>Examples of a grooved R comp tires: Kumho V710, Hoosier A6/R6, Hoosier AxS0x/SxSOx (A3S04, etc) line\n<li>Examples of non-DOT R comp tires: Hoosier R35/R45/R55/R60\n</ul>\n', null), ('2', 'Gears', 'N', null, null, 'Differential gearing modifications', null, null), ('3', 'Drivetrain', 'N', null, null, 'Drivetrain modifications', null, null), ('4', 'Transmisson', 'Y', '8', null, 'Transmission selection', null, null), ('5', 'Weight Reduction', 'N', null, null, 'Weight reduction modifications', null, 'Y'), ('6', 'Front Camber', 'N', '19', null, 'Front camber modifications', 'Note that this applies to things ADDED to the car that increase camber (camber plates, shimming the struts, swap strut hats, etc) and does not include the additional camber gained from alignments or lowering the car', null), ('7', 'Rear Camber', 'N', null, null, 'Rear camber modifications', null, null), ('8', 'Sway Bars', 'N', null, null, 'Sway bar modifications', 'BMW active rollbars option is treated the same as having aftermarket sway bars.', 'Y'), ('9', 'Shocks', 'Y', '25', null, 'Shocks selection', 'Note that a stock BMW suspension means having BMW shocks and/or BMW springs <p>If you have a sport pkg, M or JCW car, we have selected your default suspension type</p>', null), ('10', 'Springs', 'Y', '30', null, 'Springs selection', 'Note that a stock BMW suspension means having BMW shocks and/or BMW springs <p>If you have a sport pkg, M or JCW car, we have selected your default suspension type</p>', null), ('11', 'Front Wheels', 'N', null, '0.50', 'Front wheel change in width', '', null), ('12', 'Rear Wheels', 'N', null, '0.50', 'Rear wheel change in width', '', null), ('13', 'LSD', 'N', null, null, 'LSD modification', 'If you car does not come standard with a LSD, LSD points will be assigned based on your car. <p>If your car came with an LSD from the factory, do not select this.</p>', null);
COMMIT;

